import styled from 'styled-components';
import logoPic from '../../statics/logo.png';

export const HeaderWrapper = styled.div`
	position: relative;
	height: 56px;
	border-bottom: 1px solid #f0f0f0;
`;

export const Logo = styled.a`
	positon: absolute;
	left:0;
	top:0;
	display: block;
	width: 125px;
	height: 56px;
	background: url(${logoPic})
`;
